import Slider from '../Components/Slider';
import SliderOne from '../Components/SliderOne';

const Homepage = () => {
  return (
    <div className="gallery-container">
      <header className="Slider">
        <h1>Fotos</h1>
        <Slider></Slider>
        <SliderOne></SliderOne>
      </header>
    </div>
  );
};
export default Homepage;
